  const handleSearch = () => {
    const getURL = `api/search?q=${encodeURIComponent(conent)}`;
  };

  return (
    <>
      <Grid container padding={2}>
        <Grid sm={6} justifyContent="right" display="flex" padding={2}>
          <TextField
            id="search_content"
            label="Search categories"
            variant="outlined"
            onChange={(event) => {
              setContent(event.target.value);
            }}
          />
        </Grid>
        <Grid sm={6} justifyContent="left" display="flex" padding={2}>
          <Button variant="contained">Search</Button>
        </Grid>
      </Grid>
    </>
  );
}
